import React from 'react';

import {Winner} from "./WinnersBlock.styled";

const WinnersBlock = ({winnersList}) => {
    return (
        <>
            {winnersList.map((winner)=>(
                <Winner>
                    <div>{winner.name}</div>
                    <div>{winner.time}</div>
                    <div>{winner.date}</div>
                </Winner>
            ))}
        </>
    );
};

export default WinnersBlock;
